import React, { Component } from 'react'; import logo from './logo.svg';
import './App.css';
import Main from './Main.js';


class App extends Component {
  render() {
  return (
  <div className="App">
    <Main />
    <header className="App-header">
      <img src={logo} height='200px' alt="logo" />
      <h1>Index</h1>

    </header>
  </div>
    );
  }
}


export default App;
